package bean;

public class GG {

	String id;
	String nr;
	public GG() {
		super();
		// TODO Auto-generated constructor stub
	}
	public GG(String id, String nr) {
		super();
		this.id = id;
		this.nr = nr;
	}
	public String getId() {
		return id;
	}
	public void setId(String id) {
		this.id = id;
	}
	public String getNr() {
		return nr;
	}
	public void setNr(String nr) {
		this.nr = nr;
	}
	
	
}
